  \"2013-09-27T13:54:11.544414\",\n\t\"name\": \"tiger-line-shapefile-2013-series-information-file-for-the-current-all-lines-shapefil0071e\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from the U.S. Census Bureau's Master Address File / Topologically Integrated Geographic
  Encoding and Referencing (MAF/TIGER) Database (MTDB).  The MTDB represents a seamless
  national file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
  is designed to stand alone as an independent data set, or they can be combined to
  cover the entire nation.  Edge refers to the linear topological primitives that
  make up MTDB.  The All Lines Shapefile contains linear features such as roads, railroads,
  and hydrography.  Additional attribute data associated with the linear features
  found in the All Lines Shapefile are available in relationship (.dbf) files that
  users must download separately.  The All Lines Shapefile contains the geometry and
  attributes of each topological primitive edge.  Each edge has a unique TIGER/Line
  identifier (TLID) value.\",\n\t\"license_title\": \"Open Data Commons Public Domain
